import React from 'react'

export const NotificationList = ({ notifications }) => {
    if (!notifications.length){
    return <p className ="center">Нет запросов на помощь</p>
    }

    return(
        <table>
        <thead>
          <tr>
              <th>Name</th>
              <th>Item Name</th>
              <th>Item Price</th>
          </tr>
        </thead>

        <tbody>
        { notifications.map( notification =>{
            return(
            <tr>
                <td>Alvin</td>
                <td>Eclair</td>
                <td>$0.87</td>
            </tr>
            )
        }) }
        </tbody>
      </table>
    )
}
